        <div className="gender">gender</div>
        <div className="ascanddesc">ASC</div>
      </div>
      <div className="cardcontainerView">
        <div className="card">
            <img src="" alt="" />
        </div>
        </div>  
    </div>
  );
};

export default ContainerCard;
